import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => (
  <nav style={{ background: "#282c34", padding: "1rem" }}>
    <Link to="/" style={{ color: "white", marginRight: "1rem" }}>
      Register
    </Link>
    <Link to="/attendance" style={{ color: "white" }}>
      Start Attendance
    </Link>
  </nav>
);

export default Navbar;
